// components/Home/index.js
import React from 'react';
import './Home.css';
import bannerImage from 'public/marketBanner.png';

function Home() {
  return (
    <div className="home">
      <div className="banner">
        <img src={bannerImage} alt="Financial Portfolio Manager Banner" className="banner-image" />
        <h1>Welcome to Financial Portfolio Manager!</h1>
        <p>Manage and track your financial assets in one place.</p>
      </div>
      <div className="welcome-statement">
        <p>
          Explore the latest market trends, manage your stock portfolio, and make informed investment decisions with our comprehensive financial tools.
        </p>
      </div>
      {/* You can add more elements or sections as needed */}
    </div>
  );
}

export default Home;
